/** @jsxRuntime classic */
/** @jsx jsx */
import { useState } from "react";
import { jsx, Styled } from "theme-ui";
import theme from "./fonts.js";
export default function Button(props) {
  const backgroundColorBtn = props.backgroundColorBtn;
  const textColor = props.textColorBtn;
  return (
    <Styled.a>
      <Styled.div
        sx={{
          cursor: "pointer",
          mr: 3,
          mt: 3,
          backgroundColor: backgroundColorBtn,
          pt: 3,
          pb: 3,
          pr: 4,
          pl: 4,
          borderRadius: 16,
        }}
      >
        <Styled.h5
          sx={{
            fontSize: [2, 3, 4],
            fontWeight: "bold",
            color: textColorBtn,
            fontFamily:
              'system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", sans-serif',
          }}
        >
          {props.data}
        </Styled.h5>
      </Styled.div>
    </Styled.a>
  );
}
